// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "./TrustEngine.sol";

/**
 * @title ZippyCoin NFT Credentials
 * @dev Simplified NFT-based digital credentials with trust verification
 */
contract NFTCredential is ERC721, Ownable {
    using Counters for Counters.Counter;

    // Trust Engine integration
    TrustEngine public trustEngine;
    
    // Credential state
    Counters.Counter private _tokenIds;
    mapping(uint256 => string) public credentialTypes;
    mapping(uint256 => uint256) public issuanceDates;
    mapping(uint256 => uint256) public expirationDates;
    mapping(uint256 => bool) public isRevoked;
    mapping(uint256 => address) public issuers;
    mapping(uint256 => uint256) public trustScores;
    
    // Issuer management
    mapping(address => bool) public authorizedIssuers;
    mapping(address => uint256) public issuerTrustScores;
    
    // Events
    event CredentialIssued(
        uint256 indexed tokenId,
        address indexed recipient,
        string credentialType,
        uint256 trustScore,
        uint256 expirationDate
    );
    event CredentialRevoked(uint256 indexed tokenId, address indexed issuer);
    event IssuerAuthorized(address indexed issuer, uint256 trustScore);
    event IssuerRevoked(address indexed issuer);

    constructor(address _trustEngine) ERC721("ZippyCoin Credentials", "ZPC-CRED") {
        trustEngine = TrustEngine(_trustEngine);
    }

    /**
     * @dev Issue a new credential
     */
    function issueCredential(
        address recipient,
        string memory credentialType,
        uint256 expirationDate
    ) external {
        require(authorizedIssuers[msg.sender], "Not authorized issuer");
        require(recipient != address(0), "Invalid recipient");
        require(bytes(credentialType).length > 0, "Invalid credential type");
        require(expirationDate > block.timestamp, "Invalid expiration date");
        
        uint256 issuerTrustScore = trustEngine.getTrustScoreValue(msg.sender);
        require(issuerTrustScore >= 50, "Insufficient issuer trust score");
        
        uint256 recipientTrustScore = trustEngine.getTrustScoreValue(recipient);
        require(recipientTrustScore >= 20, "Insufficient recipient trust score");
        
        _tokenIds.increment();
        uint256 tokenId = _tokenIds.current();
        
        _mint(recipient, tokenId);
        
        credentialTypes[tokenId] = credentialType;
        issuanceDates[tokenId] = block.timestamp;
        expirationDates[tokenId] = expirationDate;
        issuers[tokenId] = msg.sender;
        trustScores[tokenId] = recipientTrustScore;
        
        emit CredentialIssued(tokenId, recipient, credentialType, recipientTrustScore, expirationDate);
    }

    /**
     * @dev Revoke a credential
     */
    function revokeCredential(uint256 tokenId) external {
        require(authorizedIssuers[msg.sender], "Not authorized issuer");
        require(_exists(tokenId), "Credential does not exist");
        require(!isRevoked[tokenId], "Credential already revoked");
        require(issuers[tokenId] == msg.sender, "Not the issuer");
        
        isRevoked[tokenId] = true;
        
        emit CredentialRevoked(tokenId, msg.sender);
    }

    /**
     * @dev Authorize an issuer
     */
    function authorizeIssuer(address issuer) external onlyOwner {
        require(issuer != address(0), "Invalid issuer");
        require(!authorizedIssuers[issuer], "Already authorized");
        
        uint256 trustScore = trustEngine.getTrustScoreValue(issuer);
        require(trustScore >= 50, "Insufficient trust score");
        
        authorizedIssuers[issuer] = true;
        issuerTrustScores[issuer] = trustScore;
        
        emit IssuerAuthorized(issuer, trustScore);
    }

    /**
     * @dev Revoke issuer authorization
     */
    function revokeIssuer(address issuer) external onlyOwner {
        require(authorizedIssuers[issuer], "Not an authorized issuer");
        
        authorizedIssuers[issuer] = false;
        issuerTrustScores[issuer] = 0;
        
        emit IssuerRevoked(issuer);
    }

    /**
     * @dev Get credential details
     */
    function getCredential(uint256 tokenId) external view returns (
        address owner,
        string memory credentialType,
        uint256 issuanceDate,
        uint256 expirationDate,
        bool revoked,
        address issuer,
        uint256 trustScore
    ) {
        require(_exists(tokenId), "Credential does not exist");
        
        owner = ownerOf(tokenId);
        credentialType = credentialTypes[tokenId];
        issuanceDate = issuanceDates[tokenId];
        expirationDate = expirationDates[tokenId];
        revoked = isRevoked[tokenId];
        issuer = issuers[tokenId];
        trustScore = trustScores[tokenId];
    }

    /**
     * @dev Check if credential is valid
     */
    function isCredentialValid(uint256 tokenId) external view returns (bool) {
        if (!_exists(tokenId)) return false;
        if (isRevoked[tokenId]) return false;
        if (block.timestamp > expirationDates[tokenId]) return false;
        return true;
    }

    /**
     * @dev Get total number of credentials
     */
    function totalCredentials() external view returns (uint256) {
        return _tokenIds.current();
    }

    /**
     * @dev Check if address is an authorized issuer
     */
    function isAuthorizedIssuer(address issuer) external view returns (bool) {
        return authorizedIssuers[issuer];
    }

    /**
     * @dev Get issuer trust score
     */
    function getIssuerTrustScore(address issuer) external view returns (uint256) {
        return issuerTrustScores[issuer];
    }

    /**
     * @dev Override transfer function to prevent transfers
     */
    function _transfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual override {
        revert("Credentials are non-transferable");
    }

    /**
     * @dev Override approve function to prevent approvals
     */
    function approve(address to, uint256 tokenId) public virtual override {
        revert("Credentials are non-transferable");
    }

    /**
     * @dev Override setApprovalForAll function to prevent approvals
     */
    function setApprovalForAll(address operator, bool approved) public virtual override {
        revert("Credentials are non-transferable");
    }
}

contracts/TrustEngine.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

/**
 * @title TrustEngine
 * @dev ZippyCoin Trust Engine Smart Contract
 * 
 * Implements trust scoring, delegation, and validation for the ZippyCoin ecosystem.
 * Features:
 * - Multi-metric trust scoring
 * - Trust delegation with depth limits
 * - Anti-gaming mechanisms
 * - Environmental data integration
 * - Quantum-resistant signature validation
 * - Privacy-preserving trust calculations
 */
contract TrustEngine is ReentrancyGuard, Pausable, Ownable {
    using Counters for Counters.Counter;

    // ============ STRUCTS ============
    
    struct TrustScore {
        uint256 baseScore;           // Base trust score (0-1000)
        uint256 effectiveScore;      // Effective score after delegation
        uint256 reputation;          // Reputation multiplier
        uint256 stakeAmount;         // Staked ZPC amount
        uint256 delegationDepth;     // Current delegation depth
        bool isOriginWallet;         // Is this an origin wallet
        bool isValidator;            // Is this a validator
        uint256 lastUpdate;          // Last update timestamp
        uint256 environmentalScore;  // Environmental contribution score
        uint256 privacyScore;        // Privacy compliance score
    }

    struct TrustDelegation {
        address delegator;           // Address delegating trust
        address delegate;            // Address receiving trust
        uint256 amount;              // Amount of trust delegated
        uint256 timestamp;           // Delegation timestamp
        bool isActive;               // Is delegation active
        uint256 depth;               // Delegation depth
    }

    struct EnvironmentalData {
        uint256 timestamp;           // Data timestamp
        string dataType;             // Type of environmental data
        uint256 value;               // Environmental value
        string location;             // Data location
        uint256 confidence;          // Data confidence score
        bytes signature;             // Quantum-resistant signature
    }

    struct PrivacyConfig {
        bool shareAnalytics;         // Share analytics data
        bool shareTopology;          // Share network topology
        bool shareTrustScore;        // Share trust score
        bool shareEnvironmentalData; // Share environmental data
        uint256 privacyLevel;        // Privacy level (1-3)
        bool consentGiven;           // User consent given
        uint256 consentTimestamp;    // Consent timestamp
    }

    // ============ STATE VARIABLES ============
    
    Counters.Counter private _trustScoreId;
    
    // Trust scoring parameters
    uint256 public constant MIN_TRUST_SCORE = 0;
    uint256 public constant MAX_TRUST_SCORE = 1000;
    uint256 public constant MAX_DELEGATION_DEPTH = 5;
    uint256 public constant DELEGATION_DECAY_RATE = 10; // 1% per level
    
    // Trust scores mapping
    mapping(address => TrustScore) public trustScores;
    mapping(address => bool) public hasTrustScore;
    
    // Trust delegations
    mapping(address => TrustDelegation[]) public delegations;
    mapping(address => uint256) public delegationCount;
    
    // Environmental data
    mapping(address => EnvironmentalData[]) public environmentalData;
    mapping(address => uint256) public environmentalDataCount;
    
    // Privacy configurations
    mapping(address => PrivacyConfig) public privacyConfigs;
    
    // Validators and origin wallets
    mapping(address => bool) public validators;
    mapping(address => bool) public originWallets;
    
    // Anti-gaming mechanisms
    mapping(address => uint256) public lastUpdateTime;
    mapping(address => uint256) public updateFrequency;
    mapping(address => uint256) public suspiciousActivityCount;
    
    // Events
    event TrustScoreUpdated(address indexed wallet, uint256 baseScore, uint256 effectiveScore);
    event TrustDelegated(address indexed delegator, address indexed delegate, uint256 amount);
    event TrustDelegationRevoked(address indexed delegator, address indexed delegate);
    event EnvironmentalDataAdded(address indexed wallet, string dataType, uint256 value);
    event PrivacyConfigUpdated(address indexed wallet, uint256 privacyLevel);
    event ValidatorRegistered(address indexed validator);
    event ValidatorRemoved(address indexed validator);
    event OriginWalletRegistered(address indexed wallet);
    event SuspiciousActivityDetected(address indexed wallet, string reason);

    // ============ MODIFIERS ============
    
    modifier onlyValidator() {
        require(validators[msg.sender], "TrustEngine: Only validators can call this function");
        _;
    }
    
    modifier onlyOriginWallet() {
        require(originWallets[msg.sender], "TrustEngine: Only origin wallets can call this function");
        _;
    }
    
    modifier hasValidTrustScore(address wallet) {
        require(hasTrustScore[wallet], "TrustEngine: Wallet has no trust score");
        _;
    }
    
    modifier rateLimited(address wallet) {
        require(block.timestamp >= lastUpdateTime[wallet] + updateFrequency[wallet], 
                "TrustEngine: Update too frequent");
        _;
    }

    // ============ CONSTRUCTOR ============
    
    constructor() {
        _trustScoreId.increment();
        updateFrequency[msg.sender] = 300; // 5 minutes default
    }

    // ============ CORE TRUST FUNCTIONS ============
    
    /**
     * @dev Initialize trust score for a wallet
     * @param wallet Address to initialize
     * @param baseScore Initial base score
     * @param isOrigin Whether this is an origin wallet
     */
    function initializeTrustScore(
        address wallet,
        uint256 baseScore,
        bool isOrigin
    ) external onlyValidator whenNotPaused {
        require(!hasTrustScore[wallet], "TrustEngine: Trust score already exists");
        require(baseScore <= MAX_TRUST_SCORE, "TrustEngine: Base score too high");
        
        TrustScore memory newScore = TrustScore({
            baseScore: baseScore,
            effectiveScore: baseScore,
            reputation: 100, // Default reputation
            stakeAmount: 0,
            delegationDepth: 0,
            isOriginWallet: isOrigin,
            isValidator: false,
            lastUpdate: block.timestamp,
            environmentalScore: 0,
            privacyScore: 100 // Default privacy score
        });
        
        trustScores[wallet] = newScore;
        hasTrustScore[wallet] = true;
        lastUpdateTime[wallet] = block.timestamp;
        
        if (isOrigin) {
            originWallets[wallet] = true;
            emit OriginWalletRegistered(wallet);
        }
        
        emit TrustScoreUpdated(wallet, baseScore, baseScore);
    }
    
    /**
     * @dev Update trust score with new metrics
     * @param wallet Address to update
     * @param newBaseScore New base score
     * @param environmentalContribution Environmental contribution
     * @param privacyCompliance Privacy compliance score
     */
    function updateTrustScore(
        address wallet,
        uint256 newBaseScore,
        uint256 environmentalContribution,
        uint256 privacyCompliance
    ) external onlyValidator whenNotPaused hasValidTrustScore(wallet) rateLimited(wallet) {
        require(newBaseScore <= MAX_TRUST_SCORE, "TrustEngine: Base score too high");
        require(environmentalContribution <= 100, "TrustEngine: Environmental score too high");
        require(privacyCompliance <= 100, "TrustEngine: Privacy score too high");
        
        // Anti-gaming check
        _checkSuspiciousActivity(wallet, newBaseScore);
        
        TrustScore storage score = trustScores[wallet];
        uint256 oldEffectiveScore = score.effectiveScore;
        
        // Update scores
        score.baseScore = newBaseScore;
        score.environmentalScore = environmentalContribution;
        score.privacyScore = privacyCompliance;
        score.lastUpdate = block.timestamp;
        lastUpdateTime[wallet] = block.timestamp;
        
        // Recalculate effective score
        score.effectiveScore = _calculateEffectiveScore(score);
        
        emit TrustScoreUpdated(wallet, newBaseScore, score.effectiveScore);
    }
    
    /**
     * @dev Delegate trust to another wallet
     * @param delegate Address to delegate trust to
     * @param amount Amount of trust to delegate
     */
    function delegateTrust(
        address delegate,
        uint256 amount
    ) external whenNotPaused hasValidTrustScore(msg.sender) hasValidTrustScore(delegate) {
        require(delegate != msg.sender, "TrustEngine: Cannot delegate to self");
        require(amount > 0, "TrustEngine: Delegation amount must be positive");
        require(delegationCount[msg.sender] < 10, "TrustEngine: Too many delegations");
        
        TrustScore storage delegatorScore = trustScores[msg.sender];
        TrustScore storage delegateScore = trustScores[delegate];
        
        require(delegateScore.delegationDepth < MAX_DELEGATION_DEPTH, 
                "TrustEngine: Delegate at max delegation depth");
        
        // Create delegation
        TrustDelegation memory delegation = TrustDelegation({
            delegator: msg.sender,
            delegate: delegate,
            amount: amount,
            timestamp: block.timestamp,
            isActive: true,
            depth: delegateScore.delegationDepth + 1
        });
        
        delegations[msg.sender].push(delegation);
        delegationCount[msg.sender]++;
        
        // Update delegate's effective score
        delegateScore.effectiveScore = _calculateEffectiveScore(delegateScore);
        
        emit TrustDelegated(msg.sender, delegate, amount);
    }
    
    /**
     * @dev Revoke trust delegation
     * @param delegate Address to revoke delegation from
     * @param delegationIndex Index of delegation to revoke
     */
    function revokeTrustDelegation(
        address delegate,
        uint256 delegationIndex
    ) external whenNotPaused {
        require(delegationIndex < delegations[msg.sender].length, 
                "TrustEngine: Invalid delegation index");
        
        TrustDelegation storage delegation = delegations[msg.sender][delegationIndex];
        require(delegation.delegate == delegate, "TrustEngine: Delegate mismatch");
        require(delegation.isActive, "TrustEngine: Delegation already inactive");
        
        delegation.isActive = false;
        
        // Update delegate's effective score
        if (hasTrustScore[delegate]) {
            TrustScore storage delegateScore = trustScores[delegate];
            delegateScore.effectiveScore = _calculateEffectiveScore(delegateScore);
        }
        
        emit TrustDelegationRevoked(msg.sender, delegate);
    }

    // ============ ENVIRONMENTAL DATA FUNCTIONS ============
    
    /**
     * @dev Add environmental data for trust calculation
     * @param wallet Address to add data for
     * @param dataType Type of environmental data
     * @param value Environmental value
     * @param location Data location
     * @param confidence Data confidence
     * @param signature Quantum-resistant signature
     */
    function addEnvironmentalData(
        address wallet,
        string memory dataType,
        uint256 value,
        string memory location,
        uint256 confidence,
        bytes memory signature
    ) external onlyValidator whenNotPaused {
        require(hasTrustScore[wallet], "TrustEngine: Wallet has no trust score");
        require(confidence <= 100, "TrustEngine: Confidence too high");
        
        // Verify quantum-resistant signature (simplified)
        require(_verifyEnvironmentalSignature(wallet, dataType, value, signature),
                "TrustEngine: Invalid environmental signature");
        
        EnvironmentalData memory data = EnvironmentalData({
            timestamp: block.timestamp,
            dataType: dataType,
            value: value,
            location: location,
            confidence: confidence,
            signature: signature
        });
        
        environmentalData[wallet].push(data);
        environmentalDataCount[wallet]++;
        
        emit EnvironmentalDataAdded(wallet, dataType, value);
    }

    // ============ PRIVACY FUNCTIONS ============
    
    /**
     * @dev Update privacy configuration
     * @param shareAnalytics Share analytics data
     * @param shareTopology Share network topology
     * @param shareTrustScore Share trust score
     * @param shareEnvironmentalData Share environmental data
     * @param privacyLevel Privacy level (1-3)
     */
    function updatePrivacyConfig(
        bool shareAnalytics,
        bool shareTopology,
        bool shareTrustScore,
        bool shareEnvironmentalData,
        uint256 privacyLevel
    ) external whenNotPaused {
        require(privacyLevel >= 1 && privacyLevel <= 3, "TrustEngine: Invalid privacy level");
        
        PrivacyConfig memory config = PrivacyConfig({
            shareAnalytics: shareAnalytics,
            shareTopology: shareTopology,
            shareTrustScore: shareTrustScore,
            shareEnvironmentalData: shareEnvironmentalData,
            privacyLevel: privacyLevel,
            consentGiven: true,
            consentTimestamp: block.timestamp
        });
        
        privacyConfigs[msg.sender] = config;
        
        // Update privacy score
        if (hasTrustScore[msg.sender]) {
            TrustScore storage score = trustScores[msg.sender];
            score.privacyScore = _calculatePrivacyScore(config);
            score.effectiveScore = _calculateEffectiveScore(score);
        }
        
        emit PrivacyConfigUpdated(msg.sender, privacyLevel);
    }

    // ============ VALIDATOR FUNCTIONS ============
    
    /**
     * @dev Register a new validator
     * @param validator Address to register as validator
     */
    function registerValidator(address validator) external onlyOwner whenNotPaused {
        require(hasTrustScore[validator], "TrustEngine: Validator must have trust score");
        require(!validators[validator], "TrustEngine: Already a validator");
        
        validators[validator] = true;
        trustScores[validator].isValidator = true;
        
        emit ValidatorRegistered(validator);
    }
    
    /**
     * @dev Remove a validator
     * @param validator Address to remove as validator
     */
    function removeValidator(address validator) external onlyOwner whenNotPaused {
        require(validators[validator], "TrustEngine: Not a validator");
        
        validators[validator] = false;
        trustScores[validator].isValidator = false;
        
        emit ValidatorRemoved(validator);
    }

    // ============ VIEW FUNCTIONS ============
    
    /**
     * @dev Get trust score for a wallet
     * @param wallet Address to get score for
     * @return Trust score details
     */
    function getTrustScore(address wallet) 
        external 
        view 
        hasValidTrustScore(wallet) 
        returns (TrustScore memory) 
    {
        return trustScores[wallet];
    }
    
    /**
     * @dev Get trust delegations for a wallet
     * @param wallet Address to get delegations for
     * @return Array of trust delegations
     */
    function getTrustDelegations(address wallet) 
        external 
        view 
        returns (TrustDelegation[] memory) 
    {
        return delegations[wallet];
    }
    
    /**
     * @dev Get environmental data for a wallet
     * @param wallet Address to get data for
     * @return Array of environmental data
     */
    function getEnvironmentalData(address wallet) 
        external 
        view 
        returns (EnvironmentalData[] memory) 
    {
        return environmentalData[wallet];
    }
    
    /**
     * @dev Get privacy configuration for a wallet
     * @param wallet Address to get config for
     * @return Privacy configuration
     */
    function getPrivacyConfig(address wallet) 
        external 
        view 
        returns (PrivacyConfig memory) 
    {
        return privacyConfigs[wallet];
    }
    
    /**
     * @dev Check if address is a validator
     * @param validator Address to check
     * @return True if validator
     */
    function isValidator(address validator) external view returns (bool) {
        return validators[validator];
    }
    
    /**
     * @dev Check if address is an origin wallet
     * @param wallet Address to check
     * @return True if origin wallet
     */
    function isOriginWallet(address wallet) external view returns (bool) {
        return originWallets[wallet];
    }

    // ============ INTERNAL FUNCTIONS ============
    
    /**
     * @dev Calculate effective trust score
     * @param score Trust score to calculate for
     * @return Effective trust score
     */
    function _calculateEffectiveScore(TrustScore memory score) 
        internal 
        view 
        returns (uint256) 
    {
        uint256 effectiveScore = score.baseScore;
        
        // Apply reputation multiplier
        effectiveScore = (effectiveScore * score.reputation) / 100;
        
        // Apply environmental bonus
        effectiveScore += (score.environmentalScore * 5); // 5 points per environmental point
        
        // Apply privacy bonus
        effectiveScore += (score.privacyScore * 2); // 2 points per privacy point
        
        // Apply delegation decay
        if (score.delegationDepth > 0) {
            uint256 decay = (effectiveScore * DELEGATION_DECAY_RATE * score.delegationDepth) / 1000;
            effectiveScore = effectiveScore > decay ? effectiveScore - decay : 0;
        }
        
        // Cap at maximum
        if (effectiveScore > MAX_TRUST_SCORE) {
            effectiveScore = MAX_TRUST_SCORE;
        }
        
        return effectiveScore;
    }
    
    /**
     * @dev Calculate privacy score based on configuration
     * @param config Privacy configuration
     * @return Privacy score
     */
    function _calculatePrivacyScore(PrivacyConfig memory config) 
        internal 
        pure 
        returns (uint256) 
    {
        uint256 score = 100;
        
        // Deduct points for sharing data
        if (config.shareAnalytics) score -= 10;
        if (config.shareTopology) score -= 15;
        if (config.shareTrustScore) score -= 20;
        if (config.shareEnvironmentalData) score -= 25;
        
        // Bonus for higher privacy levels
        if (config.privacyLevel == 3) score += 20;
        else if (config.privacyLevel == 2) score += 10;
        
        return score > 100 ? 100 : score;
    }
    
    /**
     * @dev Check for suspicious activity
     * @param wallet Address to check
     * @param newScore New trust score
     */
    function _checkSuspiciousActivity(address wallet, uint256 newScore) internal {
        if (hasTrustScore[wallet]) {
            TrustScore memory currentScore = trustScores[wallet];
            
            // Check for rapid score increases
            if (newScore > currentScore.baseScore * 2) {
                suspiciousActivityCount[wallet]++;
                emit SuspiciousActivityDetected(wallet, "Rapid score increase");
            }
            
            // Check for frequent updates
            if (block.timestamp - currentScore.lastUpdate < 60) {
                suspiciousActivityCount[wallet]++;
                emit SuspiciousActivityDetected(wallet, "Frequent updates");
            }
        }
    }
    
    /**
     * @dev Verify environmental data signature (simplified)
     * @param wallet Address that signed
     * @param dataType Data type
     * @param value Data value
     * @param signature Signature to verify
     * @return True if signature is valid
     */
    function _verifyEnvironmentalSignature(
        address wallet,
        string memory dataType,
        uint256 value,
        bytes memory signature
    ) internal pure returns (bool) {
        // In production, this would verify quantum-resistant signatures
        // For now, we'll use a simplified check
        return signature.length > 0;
    }

    // ============ ADMIN FUNCTIONS ============
    
    /**
     * @dev Pause the contract
     */
    function pause() external onlyOwner {
        _pause();
    }
    
    /**
     * @dev Unpause the contract
     */
    function unpause() external onlyOwner {
        _unpause();
    }
    
    /**
     * @dev Set update frequency for a wallet
     * @param wallet Address to set frequency for
     * @param frequency Minimum time between updates
     */
    function setUpdateFrequency(address wallet, uint256 frequency) external onlyOwner {
        updateFrequency[wallet] = frequency;
    }
    
    /**
     * @dev Get trust score value for a wallet
     * @param wallet Address to get trust score for
     * @return Trust score value
     */
    function getTrustScoreValue(address wallet) external view returns (uint256) {
        if (!hasTrustScore[wallet]) {
            return 0;
        }
        return trustScores[wallet].effectiveScore;
    }
}

contracts/ZippyTrustMonitor.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "./TrustEngine.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

/**
 * @title ZippyTrustMonitor
 * @dev ZIPPY Monitoring Integration for Trust Engine
 * 
 * Provides standardized monitoring endpoints for the ZippyCoin Trust Engine
 * on port 9471 (ZIPY on phone keypad). This contract exposes trust metrics
 * and health data for ecosystem monitoring.
 * 
 * Features:
 * - Trust engine health monitoring
 * - Real-time trust metrics
 * - Environmental impact tracking
 * - Privacy compliance monitoring
 * - Network topology data
 * - Standardized ZIPPY endpoints
 */
contract ZippyTrustMonitor is Ownable, ReentrancyGuard {
    
    // ============ CONSTANTS ============
    
    uint16 public constant ZIPPY_MONITOR_PORT = 9471;
    uint256 public constant MONITORING_INTERVAL = 30; // 30 seconds
    uint256 public constant HEALTH_CHECK_INTERVAL = 10; // 10 seconds
    
    // ============ STRUCTS ============
    
    struct TrustMetrics {
        uint256 totalWallets;
        uint256 activeWallets;
        uint256 averageTrustScore;
        uint256 totalDelegations;
        uint256 activeDelegations;
        uint256 environmentalContributions;
        uint256 privacyCompliance;
        uint256 suspiciousActivityCount;
        uint256 lastUpdate;
    }
    
    struct HealthStatus {
        bool isOperational;
        uint256 uptime;
        uint256 lastHealthCheck;
        uint256 errorCount;
        string status;
        uint256 port;
    }
    
    struct EnvironmentalImpact {
        uint256 totalEnvironmentalScore;
        uint256 renewableEnergyWallets;
        uint256 carbonOffsetTotal;
        uint256 dataCenterEfficiency;
        uint256 lastUpdate;
    }
    
    struct NetworkTopology {
        uint256 totalValidators;
        uint256 totalOriginWallets;
        uint256 totalDelegations;
        uint256 averageDelegationDepth;
        uint256 networkConnectivity;
        uint256 lastUpdate;
    }
    
    // ============ STATE VARIABLES ============
    
    TrustEngine public trustEngine;
    
    // Monitoring data
    TrustMetrics public trustMetrics;
    HealthStatus public healthStatus;
    EnvironmentalImpact public environmentalImpact;
    NetworkTopology public networkTopology;
    
    // Monitoring state
    uint256 public startTime;
    uint256 public lastMetricsUpdate;
    uint256 public errorCount;
    bool public isMonitoringActive;
    
    // Events
    event TrustMetricsUpdated(uint256 totalWallets, uint256 averageScore);
    event HealthCheckPerformed(bool isHealthy, uint256 uptime);
    event EnvironmentalImpactUpdated(uint256 totalScore, uint256 carbonOffset);
    event NetworkTopologyUpdated(uint256 validators, uint256 delegations);
    event MonitoringStarted(uint256 timestamp);
    event MonitoringStopped(uint256 timestamp);
    event ErrorLogged(string error, uint256 timestamp);

    // ============ CONSTRUCTOR ============
    
    constructor(address _trustEngine) {
        trustEngine = TrustEngine(_trustEngine);
        startTime = block.timestamp;
        isMonitoringActive = true;
        
        // Initialize health status
        healthStatus = HealthStatus({
            isOperational: true,
            uptime: 0,
            lastHealthCheck: block.timestamp,
            errorCount: 0,
            status: "operational",
            port: ZIPPY_MONITOR_PORT
        });
        
        emit MonitoringStarted(block.timestamp);
    }

    // ============ ZIPPY MONITORING ENDPOINTS ============
    
    /**
     * @dev ZIPPY Health Check Endpoint
     * @return Health status data
     */
    function getZippyHealth() external returns (HealthStatus memory) {
        _updateHealthStatus();
        return healthStatus;
    }
    
    /**
     * @dev ZIPPY Status Endpoint
     * @return operational Component status with trust metrics
     */
    function getZippyStatus() external returns (
        bool operational,
        string memory componentType,
        string memory componentId,
        string memory version,
        uint256 uptime,
        uint16 port,
        TrustMetrics memory metrics
    ) {
        _updateHealthStatus();
        _updateTrustMetrics();
        
        return (
            healthStatus.isOperational,
            "trust-engine",
            "zippy-trust-monitor",
            "1.0.0",
            healthStatus.uptime,
            ZIPPY_MONITOR_PORT,
            trustMetrics
        );
    }
    
    /**
     * @dev ZIPPY Metrics Endpoint
     * @return uptimeSeconds Prometheus-style metrics
     */
    function getZippyMetrics() external returns (
        uint256 uptimeSeconds,
        uint256 requestsTotal,
        uint256 errorsTotal,
        uint256 trustScore,
        uint256 peerCount,
        uint256 blockHeight
    ) {
        _updateHealthStatus();
        
        return (
            healthStatus.uptime,
            block.number, // Using block number as request count proxy
            errorCount,
            trustMetrics.averageTrustScore,
            trustMetrics.totalDelegations,
            block.number
        );
    }
    
    /**
     * @dev ZIPPY Trust Endpoint
     * @return status Trust engine status and metrics
     */
    function getZippyTrust() external returns (
        bool status,
        uint256 currentScore,
        uint256[] memory scoreHistory,
        uint256[] memory trustFactors,
        uint256 lastUpdate
    ) {
        _updateTrustMetrics();
        
        // Return trust data (simplified for Solidity)
        return (
            true, // status
            trustMetrics.averageTrustScore,
            new uint256[](0), // scoreHistory (would need array storage)
            new uint256[](0), // trustFactors (simplified to empty array for now)
            trustMetrics.lastUpdate
        );
    }
    
    /**
     * @dev ZIPPY Environment Endpoint
     * @return Environmental impact data
     */
    function getZippyEnvironment() external returns (EnvironmentalImpact memory) {
        _updateEnvironmentalImpact();
        return environmentalImpact;
    }
    
    /**
     * @dev ZIPPY Network Endpoint
     * @return Network topology data
     */
    function getZippyNetwork() external returns (NetworkTopology memory) {
        _updateNetworkTopology();
        return networkTopology;
    }
    
    /**
     * @dev ZIPPY Peers Endpoint
     * @return total Peer and delegation data
     */
    function getZippyPeers() external returns (
        uint256 total,
        uint256 active,
        uint256 trusted,
        uint256[] memory peerList,
        uint16 discoveryPort
    ) {
        _updateTrustMetrics();
        
        return (
            trustMetrics.totalWallets,
            trustMetrics.activeWallets,
            trustMetrics.totalDelegations,
            new uint256[](0), // peerList (would need array storage)
            ZIPPY_MONITOR_PORT
        );
    }

    // ============ MONITORING FUNCTIONS ============
    
    /**
     * @dev Update trust metrics
     */
    function updateTrustMetrics() external onlyOwner {
        _updateTrustMetrics();
    }
    
    /**
     * @dev Update environmental impact
     */
    function updateEnvironmentalImpact() external onlyOwner {
        _updateEnvironmentalImpact();
    }
    
    /**
     * @dev Update network topology
     */
    function updateNetworkTopology() external onlyOwner {
        _updateNetworkTopology();
    }
    
    /**
     * @dev Perform health check
     */
    function performHealthCheck() external onlyOwner {
        _updateHealthStatus();
    }
    
    /**
     * @dev Start monitoring
     */
    function startMonitoring() external onlyOwner {
        require(!isMonitoringActive, "ZippyTrustMonitor: Monitoring already active");
        isMonitoringActive = true;
        emit MonitoringStarted(block.timestamp);
    }
    
    /**
     * @dev Stop monitoring
     */
    function stopMonitoring() external onlyOwner {
        require(isMonitoringActive, "ZippyTrustMonitor: Monitoring not active");
        isMonitoringActive = false;
        emit MonitoringStopped(block.timestamp);
    }
    
    /**
     * @dev Log an error
     * @param error Error message
     */
    function logError(string memory error) external onlyOwner {
        errorCount++;
        healthStatus.errorCount = errorCount;
        emit ErrorLogged(error, block.timestamp);
    }

    // ============ INTERNAL FUNCTIONS ============
    
    /**
     * @dev Update health status
     */
    function _updateHealthStatus() internal {
        healthStatus.uptime = block.timestamp - startTime;
        healthStatus.lastHealthCheck = block.timestamp;
        healthStatus.isOperational = isMonitoringActive && errorCount < 100;
        healthStatus.status = healthStatus.isOperational ? "operational" : "degraded";
    }
    
    /**
     * @dev Update trust metrics
     */
    function _updateTrustMetrics() internal {
        // In a real implementation, this would query the TrustEngine contract
        // For now, we'll use placeholder values
        trustMetrics = TrustMetrics({
            totalWallets: 1000, // Would be actual count from TrustEngine
            activeWallets: 850, // Would be actual active count
            averageTrustScore: 750, // Would be calculated average
            totalDelegations: 2500, // Would be actual delegation count
            activeDelegations: 2200, // Would be actual active delegations
            environmentalContributions: 85, // Would be calculated from environmental data
            privacyCompliance: 92, // Would be calculated from privacy configs
            suspiciousActivityCount: 15, // Would be actual suspicious activity count
            lastUpdate: block.timestamp
        });
    }
    
    /**
     * @dev Update environmental impact
     */
    function _updateEnvironmentalImpact() internal {
        environmentalImpact = EnvironmentalImpact({
            totalEnvironmentalScore: 85000, // Would be calculated from environmental data
            renewableEnergyWallets: 650, // Would be count of wallets with renewable energy
            carbonOffsetTotal: 12500, // Would be total carbon offset
            dataCenterEfficiency: 87, // Would be calculated efficiency score
            lastUpdate: block.timestamp
        });
    }
    
    /**
     * @dev Update network topology
     */
    function _updateNetworkTopology() internal {
        networkTopology = NetworkTopology({
            totalValidators: 50, // Would be actual validator count
            totalOriginWallets: 100, // Would be actual origin wallet count
            totalDelegations: 2500, // Would be actual delegation count
            averageDelegationDepth: 2, // Would be calculated average depth
            networkConnectivity: 85, // Would be calculated connectivity score
            lastUpdate: block.timestamp
        });
    }

    // ============ VIEW FUNCTIONS ============
    
    /**
     * @dev Get monitoring configuration
     * @return port Monitoring configuration data
     */
    function getMonitoringConfig() external view returns (
        uint16 port,
        uint256 monitoringInterval,
        uint256 healthCheckInterval,
        bool isActive,
        uint256 startTimestamp
    ) {
        return (
            ZIPPY_MONITOR_PORT,
            MONITORING_INTERVAL,
            HEALTH_CHECK_INTERVAL,
            isMonitoringActive,
            startTime
        );
    }
    
    /**
     * @dev Get all monitoring data
     * @return health Complete monitoring data
     */
    function getAllMonitoringData() external returns (
        HealthStatus memory health,
        TrustMetrics memory metrics,
        EnvironmentalImpact memory environment,
        NetworkTopology memory topology
    ) {
        _updateHealthStatus();
        _updateTrustMetrics();
        _updateEnvironmentalImpact();
        _updateNetworkTopology();
        
        return (healthStatus, trustMetrics, environmentalImpact, networkTopology);
    }
}

